'''Zombies''' are generic monsters found throughout [[Gielinor]] as a result of [[Necromancer (disambiguation)|Necromancers]] reanimating their bodies, just like [[Skeletons]]. This means they count as [[Undead|undead NPCs]] and are weak to the effects of both the [[Salve amulet]] and the [[Crumble Undead]] spell.

Most zombies will be low level, hence serving as a decent training method for low-levelled players.

